# -*- coding: utf-8 -*-
"""
@author : zenithude
Find All Anagrams in a String

Given a string s and a non-empty string p, find all the start indices of p's anagrams in s.

Strings consists of lowercase English letters only and the length of both strings s and p will not be larger than 20,100.

The order of output does not matter.

Example 1:

Input:
s: "cbaebabacd" p: "abc"

Output:
[0, 6]

Explanation:
The substring with start index = 0 is "cba", which is an anagram of "abc".
The substring with start index = 6 is "bac", which is an anagram of "abc".

Example 2:

Input:
s: "abab" p: "ab"

Output:
[0, 1, 2]

Explanation:
The substring with start index = 0 is "ab", which is an anagram of "ab".
The substring with start index = 1 is "ba", which is an anagram of "ab".
The substring with start index = 2 is "ab", which is an anagram of "ab".

"""
from typing import List

MAX = 256


# This function returns true
# if contents of arr1[] and arr2[]
# are same, otherwise false.
def compare(arr1, arr2):
    for i in range(MAX):
        if arr1[i] != arr2[i]:
            return False
    return True


class Solution(object):
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        if not s or not p:
            return None
        lengthA, lengthB, indiceList = len(s), len(p), []
        if lengthA == 0 or lengthB == 0:
            return None
        if lengthB > lengthA:
            return None

        # countP[]:  Store count of
        # all characters of pattern
        # countTW[]: Store count of
        # current window of text
        countP = [0] * MAX
        countTW = [0] * MAX
        for i in range(lengthB):
            P = ord(p[i])
            S = ord(s[i])
            countP[P] += 1
            countTW[S] += 1

        # Traverse through remaining character of p
        for i in range(lengthB, lengthA):
            S = ord(s[i])
            prevS = ord(s[i - lengthB])
            # Compare counts of current windows of s with counts of p
            if compare(countP, countTW):
                indiceList.append(i - lengthB)
            # add current character to current window
            countTW[S] += 1
            # remove the first character of previous window
            countTW[prevS] -= 1

        # check for the last window in s
        if compare(countP, countTW):
            indiceList.append(lengthA - lengthB)

        return indiceList


def computeLpsArray(p, lengthP, lps):
    length = 0  # length of the previous longest prefix suffix
    lps[0] = 0  # lps[0] is always 0
    i = 1
    # the loop to calculate lps[i] for i = 1 to lengthP - 1
    while i < lengthP:
        if p[i] == p[length]:
            length += 1
            lps[i] = length
            i += 1
        else:
            # this is tricky. Consider the example AAACAAAA and i = 7. The
            # idea is similar to search step.
            if length != 0:
                length = lps[
                    length - 1]  # also note that we don't increment i here
            else:
                lps[i] = 0
                i += 1
    return lps


class Solution1(object):
    def findAnagrams(self, s, p):
        """
        fonction trop lente pour les chaines trop longue
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        if not s or not p:
            return None
        lengthA, lengthB, indiceList = len(s), len(p), []
        if lengthA == 0 or lengthB == 0:
            return None
        for i in range((lengthA - lengthB) + 1):
            temp = s[i: lengthB + i]
            if sorted(temp) == sorted(p):
                indiceList.append(i)
        return indiceList


class Solution2(object):
    def findAnagrams(self, s, p):
        """
        Ne trouve que les chaine identique , pas les anagrame
        :type s: str
        :type p: str
        :rtype: List[int]
        """
        if not s or not p:
            return None
        lengthA, lengthB, indiceList = len(s), len(p), []
        if lengthA == 0 or lengthB == 0:
            return None
        # create lps[] that will hold the longest prefix suffix value for p
        lps = [0] * lengthB
        i = 0  # index for s
        j = 0  # index for p
        # Preprocess the pattern p ( calculate lps[] array )
        lps = computeLpsArray(p, lengthB, lps)

        while i < lengthA:
            if p[j] == s[i]:
                i += 1
                j += 1

            if j == lengthB:
                indiceList.append(i - j)
                j = lps[j - 1]
            # mismatch after j matches
            elif i < lengthA and p[j] != s[i]:
                # Do not match lps[0..lps[j - 1]] characters, they will
                # match anyway
                if j != 0:
                    j = lps[j - 1]
                else:
                    i += 1
        return indiceList





obj = Solution()
s1, s2 = "abab", "ab"
# s1 =
